  false,\n\t\"url\": null,\n\t\"notes\": \"Wind wave spectra and meteorological data
  were collected from FIXEDnPLATFORMS in the East/West coasts of US, North Pacific
  Ocean, Gulf ofnMexico, Gulf of Alaska, Great Lakes, and other locations. Data werencollected
  from buoys with surface and subsurface sensors from 01nSeptember 2002 to 31 September
  2002. Data were submitted by the NationalnData Buoy Center (NODC).nnStation identifier,
  position, date, time, sampling duration and samplingnrate are reported for each
  series of measurements. Reportednmeteorological parameters may include air temperature
  and pressure, dewnpoint, wind speed and direction, wind gust, visibility, precipitationnand
  solar radiation. Ocean surface data may include water temperaturenand salinity (or
  conductivity), significant wave height and steepness.nSubsurface temperature, salinity,
  conductivity, pressure, and east andnnorth current components may also be reported.
  Wave data may be reportednas spectral density values or (for directional spectra)
  as co- andnquad-spectra or angular Fourier coefficients.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
